import NavBar from "./NavBar";
import SocialNetwork from './SocialNetwork'
const About = ()=>{
    return (
        <>
            <NavBar/>
            <div className="about">
                <SocialNetwork/>
                <img src="image/photo.jpg" alt="not found" />
                <div className="right_side">
                    <h1> ABOUT ME</h1>
                    <p className="first">Hello my name is Nand Makadia</p>
                    <p>I am a MERN stack Web developer</p>
                    <p>I am currently Persuing Computer Engineering</p>
                    <p>Till now, I have completed a few Project <br /> as mentioned in my Portfolio</p>
                    <a href="/image/CV.pdf" className="btn" download>DOWNLOAD CV</a>
                    
                </div>
            </div>
        </>
        
    );
};
export default About;
